class Solution:
    def maxOperations(self, s: str) -> int:
        dif=0
        p=0
        q=0
        h=[]
        k=0
        for i in range(len(s)):
            if s[i]=="1":
                h.append(1)
                k=1
            if s[i]=="0" and k==1:
                h.append(0)
                k=0
        for x in h:
            if x==1:
                p+=1
            else:
                dif+=p
        return dif
